const fixTabToggle = (li, tab) => {
	document.querySelectorAll("ul.tabs > li").forEach((item) => {
		item.setAttribute("class", "tabs-li");
	});
	li.setAttribute("class", "tabs-li active");
	document.querySelectorAll("div.tabs-content > div").forEach((item) => {
		item.setAttribute("class", "tab-content not-active");
	});
	tab.setAttribute("class", "tab-content active");

}

const get_line = (titles) => {
	let anime_index = -1;
	console.log(titles);
	for(let title in titles){
		const p = /[.;:,—]/;
		const filteredTitle = titles[title].replace(p, "");
		for(let i = 0; i < data['data'].length; i++){
			const curr_line = data['data'][i];
			const anime_f = curr_line[0] ? curr_line[0].replace(p, "") : "";
			const english = curr_line[3] ? curr_line[3].replace(p, "") : "";
			const japanese = curr_line[4] ? curr_line[4].replace(p, "") : "";
			if(japanese	=== filteredTitle || anime_f === filteredTitle || english === filteredTitle){
				anime_index	= i;
				break;
			}
			if(curr_line[5]){
				const synonyms = curr_line[5].split(",");
				for(let j = 0; j<synonyms.length; j++){
					const f_synonyms = synonyms[j].replace(p, "");
					if(f_synonyms === filteredTitle){
						anime_index = i;
						break;
					}
				}
			}

		}
		if(anime_index>-1){
			break;
		}

	}
	return anime_index>-1 ? data['data'][anime_index] : false;
};

const get_top_k = (x, y, top_k) => {

	const distances = [];
	data.data.forEach((line) => distances.push([(x-line[1])*(x-line[1]) + (y-line[2])*(y-line[2]), line]));
	return distances.sort((a, b) => a[0]-b[0]).slice(1, top_k+1);

};

const create_li = (tab) => {

	const li = document.createElement("li")
	li.innerHTML = "Рекомендации anime2vec";
	li.classList.add("tabs-li");
	li.setAttribute("data-id", "#anime2vec-recs");
	li.addEventListener("click", (e) => {
		fixTabToggle(li, tab);
	});
	return li;

};

const createDataTab = (recs, neighbors) => {

	const tab = document.createElement("div");
	for(let i = 0; i < recs.length; i++){

		const anime_info = document.createElement("div");
		anime_info.setAttribute("class", "anime-column-info");
		const anime_info_text = document.createElement("a");
		anime_info_text.setAttribute("class", "anime-title");
		anime_info_text.innerHTML = recs[i][1][0] + " | Dist: " + recs[i][0];
		anime_info.appendChild(anime_info_text);
		tab.appendChild(anime_info);

	}
	tab.setAttribute("id", "anime2vec-recs");
	tab.setAttribute("class", "tab-content not-active");
	return tab;

};

const get_neighbors = (x, y, radius) => {
	const distances = [];
	data.data.forEach((line) => {

		const dist = (x-line[1])*(x-line[1]) + (y-line[2])*(y-line[2]);
		if(dist <= radius*radius)
				distances.push(line)
	});
	return distances;

};

const edit_page = () => {
	let filterPages = 1;

		if(filterPages !== 0){
			const titles = [];
			document.querySelectorAll(".alt-names-list li").forEach((li) => {titles.push(li.innerText)});
			const desc_title = get_line(titles);
			const recs = get_top_k(desc_title[1], desc_title[2], 10);
			const neighbors = get_neighbors(desc_title[1], desc_title[2], 4);	
			const tab = createDataTab(recs, neighbors);
			const li = create_li(tab);
			

			document.querySelector("ul.tabs").appendChild(li);
			document.querySelector("div.tabs-content").appendChild(tab);
		}
};
